module poly_derivative_new
  implicit none

  private
  
  public :: get_associated_legendre_polynomial_derivative

  contains

    subroutine io_error(str)
      implicit none
      ! dummy
      character(len=*) :: str

      print *, "io ERROR"
      print *, "  ", str
    end subroutine

    function cot(x)
      implicit none
      ! dummy
      double precision :: x
      double precision :: cot

      cot = 1.0/tan(x)
    end function

    function csc(x)
      implicit none
      ! dummy
      double precision :: x
      double precision :: csc

      csc = 1.0_8/sin(x)
    end function

    function get_associated_legendre_polynomial_derivative(l,m,x) result(erg)
