      ! dummy
      integer(kind=4) :: l
      integer(kind=4) :: m
      double precision :: x

      double precision :: erg

      !auxiliary
      double precision :: sin_x
      double precision :: cos_x
      
      sin_x = sin(x)
      cos_x = cos(x)
      

      select case(l)

      case(1) !********************* l=1_8
        select case(m)
        case(-1)
          erg=0.5_8*Cot(x)*Sqrt(sin_x**2_8)
        case(0)
          erg=-1._8*sin_x
        case(1)
          erg=-1._8*Cot(x)*Sqrt(sin_x**2_8)
        case default
          call io_error("m out of range")
        end select

      case(2) !********************* l=2_8
